# The kart contains a hardcoded encryption key which I'm unsure can be
# distributed legally, or even ethically. Fortunately, this key is only used
# for encrypting a 128-bit nonce which is used to derive the actual network
# key. The workaround is this file: a table of pre-encrypted nonces.

# For pairing, there are no security drawbacks to doing this, since the PSK
# (which is also used in deriving the network key) is unique every time. After
# pairing, however, the PSK is static, and the uniqueness of the nonce is vital
# in ensuring that the network traffic can't be cryptanalyzed by someone with a
# sniffer. While it's impossible to guarantee uniqueness with this approach,
# the probability of a reused nonce can be greatly reduced by selecting them
# carefully.

# There are 2^16 nonces here, so each one gets a 16-bit ID. When selecting a
# nonce, the first 12 bits are chosen by time (in 30-minute intervals, for a
# period of ~85 days) while the remaining 4 bits are chosen sequentially (with
# the first choice being random).

import time
import struct
import random
import binascii


def get_encrypted_nonce(i: int):
    # Rather than base64-decode the whole thing, let's just grab the snippet
    # we care about.

    # "Blocks" are 3 nonces each, or 64 base64 chars
    block, offset = divmod(i, 3)

    start_char = block*64
    stop_char  = (block+1)*64

    # Adjust for newlines in the string
    line_length = NONCES.find('\n')
    start_char += (start_char//line_length)
    stop_char  += (stop_char //line_length)

    # Decode
    nonces = binascii.a2b_base64(NONCES[start_char:stop_char])
    nonce = nonces[offset*16:(offset+1)*16]

    return nonce


def get_plaintext_nonce(i: int):
    return struct.pack('>12sHH', WELL_KNOWN, REVISION, i)


def get_nonce_pair(*, pure_random: bool = False):
    if pure_random:
        i = random.randrange(0x10000)
    else:
        i = get_seq()

    return get_plaintext_nonce(i), get_encrypted_nonce(i)


_seq = None
def get_seq():
    global _seq
    if _seq is None:
        _seq = random.randrange(16)

    _seq = (_seq+1)&0xF

    now = int(time.time())
    return ((now//SEQ_PERIOD)<<4 | _seq)&0xFFFF


SEQ_PERIOD = 30*60
WELL_KNOWN = b'WellKnownStr'
REVISION   = 0x0001

